			undefined,
			[Validators.required, Validators.email, AuthInputValidator.validateEmailDomain],
			[AuthInputValidator.validateEmailIsTaken(this._registerUserFacade)],
		),
		firstName: new FormControl(undefined, [Validators.required]),
